import Label from '../label/label'
import Paragraph from "../paragraph/paragraph"

const Div = ({ClassDiv})=>{
    return(
        <div className={ClassDiv}>
            <Label textLabel="Bayekula"/>
            <Label textLabel="Hobed"/>

            <Paragraph ClassName="Bio" Biography="Je suis hobed bayekula apprenant à Kinshasa Digital Academy"/>
        </div>
    );
}
export default Div;
